   function returntoken() {
       $desk_config = array(
           'client_id' => '1000.FMKDOXOCOHH4RIQOHT1U8CZT3VCE1O',
           'client_secret' => '5fe15d171902a3cfa37e6e9039717cc7300dbc2176',
           'refresh_token' => '1000.f568eccc82435d48b9274aa0add0203b.4378012dd7d8b0f0ec8146002640eff1',
           'grant_type' => 'refresh_token',
           'api_url' => 'https://www.zohoapis.in/api/v3/',
           'account_domain' => 'https://accounts.zoho.in/',
       );
       $zoho_desk_session = file_get_contents('zoho/access_token.json');
       $current_time = date('Y-m-d H:i:s');
       $jSonData = json_decode($zoho_desk_session);
       
       if (isset($jSonData->access_token) && ($current_time < $jSonData->expiring_at)) {
           return $jSonData->access_token;
       } else {
           $url = $desk_config['account_domain'] . 'oauth/v2/token';
           $postData = [
               'client_id' => $desk_config['client_id'],
               'client_secret' => $desk_config['client_secret'],
               'refresh_token' => $desk_config['refresh_token'],
               'grant_type' => $desk_config['grant_type']
           ];
           $ch = curl_init();
           curl_setopt($ch, CURLOPT_URL, $url);
           curl_setopt($ch, CURLOPT_POST, true);
           curl_setopt($ch, CURLOPT_POSTFIELDS, http_build_query($postData));
           curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, false);
           curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
           $response = curl_exec($ch);
           curl_close($ch);
           $response1 = json_decode($response);
           if (isset($response1->access_token)) {
               $now = time();
               $endDate = date('Y-m-d H:i:s', strtotime("+10 minutes"));
               $response1->expiring_at = $endDate;
               file_put_contents('zoho/access_token.json', json_encode($response1));
               return $response1->access_token;
           } else {
               throw new Exception("Error Processing Request", 1);
           }
       }
   }

